import { Component } from "react";

import Event from "./Event";

class OrgEventList extends Component {
    constructor(props) {
        super(props)
    }

    async componentDidMount() {
        this.setState([{
            name: "org name"
        }]);
    }


    render() {
        if (!this.state) {
            return <div/>;
        }

        console.log(this.state);

        const events = this.state.map((evt) => {
            return (<li><Event model={evt}/></li>)
        });


        return (
            <ol>
                {events}
            </ol>
        );
    }
};

export default class Org extends Component {
    constructor(props) {
        super(props);
    }

    componentDidMount() {
        this.setState({
            name: "org name"
        });
    }

    imgSrc() {
        return `/api/orgs/${this.props.orgID}/logo`
    }

    render() {
        if (!this.state) {
            return <div/>;
        }


        return (
            <div>
                <img src={this.imgSrc()} className="org-logo" />
                <h1>{this.state.name}</h1>
                <p>{this.state.description}</p>
                <OrgEventList orgID={this.props.orgID} />
            </div>
        );
    }
}
